const modifierEls = document.querySelectorAll(".modifier");
for (const modifierEl of modifierEls) {
    modifierEl.addEventListener("click", function(event) {
        event.preventDefault(); // Don't follow the link
        let val = parseInt(event.target.getAttribute("data-val"));
        let inputModifierId = event.target.getAttribute("data-el-id");
        if (inputModifierId) {
            let inputModifierEl = document.querySelector("#"+inputModifierId);
            inputModifierEl.value = parseInt(inputModifierEl.value) + val ;
            createFinalSvg();
        }
    }, false);
}

